import React, { Fragment } from "react";
import gLogo from "../../img/hd.png";

const logo = props => (
  <Fragment>
    <div className='Logo'>
      <img src={gLogo} alt='GUARDIAN' />
    </div>
  </Fragment>
);
export default logo;
